var title_f13_47_14076="Revised CKD classification based upon GFR and albuminuria";
var content_f13_47_14076=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F70597&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F70597&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Revised chronic kidney disease classification based upon GFR and albuminuria",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        GFR stages",
"       </td>",
"       <td class=\"subtitle1\">",
"        GFR",
"        <br/>",
"        (mL/min/1.73 m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
"       <td class=\"subtitle1\">",
"        Terms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G1",
"       </td>",
"       <td>",
"        &gt;90",
"       </td>",
"       <td>",
"        Normal or high",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G2",
"       </td>",
"       <td>",
"        60 to 89",
"       </td>",
"       <td>",
"        Mildly decreased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G3a",
"       </td>",
"       <td>",
"        45 to 59",
"       </td>",
"       <td>",
"        Mildly to moderately decreased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G3b",
"       </td>",
"       <td>",
"        30 to 44",
"       </td>",
"       <td>",
"        Moderately to severely decreased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G4",
"       </td>",
"       <td>",
"        15 to 29",
"       </td>",
"       <td>",
"        Severely decreased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G5",
"       </td>",
"       <td>",
"        &lt;15",
"       </td>",
"       <td>",
"        Kidney failure (add D if treated by dialysis)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1\">",
"        Albuminuria stages",
"       </td>",
"       <td class=\"subtitle1\">",
"        AER",
"        <br/>",
"        (mg/day)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Terms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A1",
"       </td>",
"       <td>",
"        &lt;30",
"       </td>",
"       <td>",
"        Normal to mildly increased (may be subdivided for risk prediction)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A2",
"       </td>",
"       <td>",
"        30 to 299",
"       </td>",
"       <td>",
"        Moderately increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A3",
"       </td>",
"       <td>",
"        &ge;300",
"       </td>",
"       <td>",
"        Severely increased (may be subdivided into nephrotic and non-nephrotic for differential diagnosis, management, and risk prediction)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The cause of CKD is also included in the KDIGO revised classification but is not included in this table.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       KDIGO. Summary of recommendation statements. Kidney Int 2013; 3(Suppl):5.",
"      </li>",
"      <li>",
"       National Kidney Foundation. K/DOQI clinical practice guidelines for chronic kidney disease: evaluation, classification, and stratification. Am J Kidney Dis 2002; 39(2 Suppl 1):S1.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
